def predict(triples: list[Triple]) -> str:
    sentences = []
    for triple in triples:
        predicate = triple.predicate
        subject = triple.subject
        object_val = triple.object

        if predicate == "almaMater":
            sentences.append(f"{subject} attended {object_val}.")
        elif predicate == "birthDate":
            sentences.append(f"{subject} was born on {object_val}.")
        elif predicate == "birthPlace":
            sentences.append(f"{subject} was born in {object_val}.")
        elif predicate == "dateOfRetirement":
            sentences.append(f"{subject} retired in {object_val}.")
        elif predicate == "occupation":
            sentences.append(f"{subject} worked as a {object_val}.")
        elif predicate == "status":
            sentences.append(f"{subject}'s status is {object_val}.")
        elif predicate == "timeInSpace":
            sentences.append(f"{subject} spent {object_val} in space.")
        elif predicate == "mission":
            sentences.append(f"{subject} participated in the {object_val} mission.")
        elif predicate == "selectedByNasa":
            sentences.append(f"{subject} was selected by NASA in {object_val}.")
        elif predicate == "deathDate":
            sentences.append(f"{subject} passed away on {object_val}.")
        elif predicate == "nationality":
            sentences.append(f"{subject} was of {object_val} nationality.")
        else:
            if predicate == "nationality" and "birthPlace" in [t.predicate for t in triples if t.subject == subject]:
                birthplace_triple = next((t for t in triples if t.subject == subject and t.predicate == "birthPlace"), None)
                if birthplace_triple:
                    sentences.append(f"{subject} was born in {birthplace_triple.object} and is a national of {object_val}.")
                    continue
            elif predicate == "mission" and "status" in [t.predicate for t in triples if t.subject == subject]:
                status_triple = next((t for t in triples if t.subject == subject and t.predicate == "status"), None)
                if status_triple:
                    sentences.append(f"{subject} participated in the {object_val} mission and is currently {status_triple.object}.")
                    continue
            sentences.append(f"{subject} {predicate} {object_val}.")

    return " ".join(sentences)

